import useTweets from "./utils/useTweets"

function App() {
const tweets = useTweets()

	return (
		//print out list of tweets in real-time as they are updated by useTweets hook
		<div>
			{tweets.map((tweet) => (
				<p>{tweet.text}</p>
			))}
		</div>

		// <p>
		//   It's <time dateTime={tweets.text}>{tweets.text}</time>
		// </p>
	);
}

export default App;
